<?php
$tables = array(

'contact' => "
  content_id I4 PRIMARY,
  contact_id I4 NOTNULL,
  parent_id I4 NOTNULL,
  surname C(32),
  forename C(32),
  home_phone C(20),
  mobile_phone C(20),
  email_address C(128),
  description C(160)
",

'contact_type' => "
  contact_type_id I4 PRIMARY,
  type_name	C(64)
",

'contact_type_map' => "
  content_id I4 PRIMARY,
  contact_type_id I4 PRIMARY,
  type_value	I4
",

'countries' => "
  countries_id I4 PRIMARY AUTO,
  countries_name C(64),
  countries_iso_code_2 C(2),
  countries_iso_code_3 C(3),
  countries_iso_code_num I4,
  address_format_id I4
",

'zones' => "
  zone_id I4 PRIMARY AUTO,
  zone_country_id I4,
  zone_code C(32),
  zone_name C(64)
",

'address_book' => "
  content_id I4 PRIMARY AUTO,
  contact_id I4,
  entry_gender C(1),
  entry_company C(128),
  entry_firstname C(64),
  entry_lastname C(64),
  entry_street_address C(250),
  entry_suburb C(64),
  entry_city C(64),
  entry_state C(64),
  entry_postcode C(10),
  entry_country_id I4,
  entry_zone_id I4,
  entry_telephone C(32)
  CONSTRAINT ', CONSTRAINT `addr_book_zone_ref` FOREIGN KEY ( `entry_zone_id` ) REFERENCES `".BIT_DB_PREFIX."zones`( `zone_id` )
  			  , CONSTRAINT `addr_book_country_ref` FOREIGN KEY ( `entry_country_id` ) REFERENCES `".BIT_DB_PREFIX."countries`( `countries_id` )'
",

'address_format' => "
  address_format_id I4 PRIMARY AUTO,
  address_format C(128),
  address_summary C(48)
",

);

global $gBitInstaller;

$gBitInstaller->makePackageHomeable('contacts');

foreach( array_keys( $tables ) AS $tableName ) {
	$gBitInstaller->registerSchemaTable( CONTACTS_PKG_NAME, $tableName, $tables[$tableName] );
}

$gBitInstaller->registerPackageInfo( CONTACTS_PKG_NAME, array(
	'description' => "Base Contact management package with contact books and address books",
	'license' => '<a href="http://www.gnu.org/licenses/licenses.html#LGPL">LGPL</a>',
) );

